import React from 'react';
import styled from 'styled-components';
import { COLORS } from '../styles/colors';

// Easily changeable hero content
const HERO_HEADING = (
  <>
    <span style={{ color: '#b3b3b3', fontWeight: 400 }}>Hey!</span> <span style={{ fontWeight: 700 }}>Custom AI</span>
    <br />
    <span style={{ color: '#b3b3b3', fontWeight: 400 }}>(0â†’1)</span> <span style={{ fontWeight: 700 }}>solutions</span>
  </>
);
const HERO_SUBTITLE = 'We build tailored AI solutions for your business.';
const HERO_BUTTON = 'Get Started';
const HERO_IMAGE_ALT = 'Custom AI Illustration';

const HeroSection = styled.section`
  position: relative;
  min-height: 70vh;
  display: flex;
  align-items: flex-start;
  justify-content: center;
  background: #fafbfa;
  padding: 6vw 0 2vw 0;
  overflow: visible;
  @media (max-width: 900px) {
    flex-direction: column;
    align-items: center;
    min-height: 0;
    padding: 2.5rem 0 1.5rem 0;
  }
`;

const FloatingIcon = styled.div`
  position: absolute;
  left: 0;
  top: -2.5rem;
  width: 48px;
  height: 48px;
  background: #fff;
  border-radius: 12px;
  box-shadow: 0 2px 8px rgba(24,75,84,0.07);
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 2rem;
  color: #184B54;
  z-index: 2;
  @media (max-width: 900px) {
    left: 50%;
    transform: translateX(-50%);
    top: -2.5rem;
  }
`;

const HeroContent = styled.div`
  position: relative;
  z-index: 1;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin-left: 7vw;
  margin-top: 2vw;
  @media (max-width: 900px) {
    align-items: center;
    margin-left: 0;
    margin-top: 0;
    text-align: center;
  }
`;

const HeroHeading = styled.h1`
  font-family: 'JetBrains Mono', 'Fira Mono', 'Menlo', 'monospace';
  font-size: 3.1rem;
  font-weight: 700;
  color: #222;
  margin: 0 0 1.1rem 0;
  line-height: 1.08;
  letter-spacing: -0.01em;
  @media (max-width: 700px) {
    font-size: 2rem;
  }
`;

const HeroSubtitle = styled.p`
  font-size: 1.18rem;
  color: #555;
  margin: 0 0 2.1rem 0;
  font-weight: 400;
  max-width: 420px;
  @media (max-width: 700px) {
    font-size: 1.05rem;
    margin-bottom: 1.3rem;
  }
`;

const HeroButton = styled.a`
  background: #fff;
  color: #222;
  font-size: 1.1rem;
  font-family: 'JetBrains Mono', 'Fira Mono', 'Menlo', 'monospace';
  font-weight: 600;
  border: none;
  border-radius: 12px;
  padding: 0.9rem 2.1rem;
  text-decoration: none;
  cursor: pointer;
  display: inline-block;
  box-shadow: 0 2px 8px rgba(24,75,84,0.09);
  transition: background 0.18s, color 0.18s;
  margin-top: 0.7rem;
  &:hover {
    background: #184B54;
    color: #fff;
  }
`;

const HeroImageWrapper = styled.div`
  position: absolute;
  right: 7vw;
  top: 0;
  z-index: 0;
  @media (max-width: 900px) {
    position: static;
    margin-top: 2.2rem;
    width: 100%;
    display: flex;
    justify-content: center;
  }
`;

const HeroImage = styled.div`
  width: 340px;
  height: 420px;
  background: #eee;
  border-radius: 18px;
  box-shadow: 0 2px 16px rgba(24,75,84,0.06);
  display: flex;
  align-items: center;
  justify-content: center;
  color: #bbb;
  font-size: 1.2rem;
  font-weight: 500;
  @media (max-width: 700px) {
    width: 90vw;
    max-width: 340px;
    height: 260px;
  }
`;

const CustomAI = () => (
  <main>
    <HeroSection>
      <HeroContent>
        <FloatingIcon>*</FloatingIcon>
        <HeroHeading>{HERO_HEADING}</HeroHeading>
        <HeroSubtitle>{HERO_SUBTITLE}</HeroSubtitle>
        <HeroButton href="mailto:hello@example.com">{HERO_BUTTON}</HeroButton>
      </HeroContent>
      <HeroImageWrapper>
        <HeroImage aria-label={HERO_IMAGE_ALT}>[image]</HeroImage>
      </HeroImageWrapper>
    </HeroSection>
    {/* Add more page content here */}
  </main>
);

export default CustomAI;
